function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
  }

class Test extends React.Component
{
    userName(name)
    {
        return(
            <h1><strong>{name}</strong></h1>
        );
    }

    userAge(age)
    {
        return(
            <div><h2>Age: </h2>{age}</div>
        );
    }

    userGender(gender)
    {
        return(
            <div><h2>Gender: </h2>{gender}</div>
        );
    }

    render()
    {
        return(
            <div>
                <div>{userName(this.props.name)}</div>
            </div>
        );
    }
}


